import styles from "./Footer.module.scss";
const Footer = ({ data }: any) => {
	return (
		<div className={styles.footer}>
			<div className={styles.keyContainer}>
				<div className={styles.key}>
					<div
						className={styles.bubble}
						style={{ backgroundColor: "#5d9cec" }}
					></div>
					<div>Continuing (All episodes downloaded)</div>
				</div>
				<div className={styles.key}>
					<div
						className={styles.bubble}
						style={{ backgroundColor: "#27c24c" }}
					></div>
					<div>Ended (All episodes downloaded)</div>
				</div>
				<div className={styles.key}>
					<div
						className={styles.bubble}
						style={{ backgroundColor: "#f05050" }}
					></div>
					<div>Missing Episodes (Series monitored)</div>
				</div>
				<div className={styles.key}>
					<div
						className={styles.bubble}
						style={{ backgroundColor: "#ffa500" }}
					></div>
					<div>Missing Episodes (Series not monitored)</div>
				</div>
			</div>
			<div className={styles.dataContainer}>
				<div className={styles.data}>
					{"Series " + (data ? data.length : 0).toString()}
				</div>
				<div className={styles.data}>
					{"Ended " + (data ? data.length : 0).toString()}
				</div>
				<div className={styles.data}>
					{"Continuing " + (data ? data.length : 0).toString()}
				</div>
				<div className={styles.data}>
					{"Monitored " + (data ? data.length : 0).toString()}
				</div>
				<div className={styles.data}>
					{"Unmonitored " + (data ? data.length : 0).toString()}
				</div>{" "}
				<div className={styles.data}>
					{"Episodes " + (data ? data.length : 0).toString()}
				</div>
				<div className={styles.data}>
					{"Files " + (data ? data.length : 0).toString()}
				</div>
				<div className={styles.data}>
					{"Total Size " + (data ? data.length : 0).toString()}
				</div>
			</div>
		</div>
	);
};
export default Footer;
